import com.google.common.collect.TreeRangeSet;
import com.google.common.collect.Range;
import com.google.common.collect.HashMultimap;
import com.google.common.collect.Multimap;

public class Main {
    public static void main(String[] args) {
        TreeRangeSet<Integer> rangeSet = TreeRangeSet.create();
        Multimap<String, Integer> multimap = HashMultimap.create();

        // Adding ranges to the TreeRangeSet
        /* write */ rangeSet.add(Range.closed(1, 10));

        // Adding entries to the Multimap
        multimap.put("Group1", 5);
        multimap.put("Group1", 15);
        multimap.put("Group2", 25);

        // Perform some operations on Multimap
        System.out.println("Values in Group1:");
        for (Integer value : multimap.get("Group1")) {
            System.out.println(value);
        }

        // Adding more ranges to the TreeRangeSet
        rangeSet.add(Range.closed(20, 30));
        rangeSet.add(Range.closed(40, 50));

        // Check if certain values are contained within the ranges
        boolean containsValue1 = rangeSet.contains(8);
        boolean containsValue2 = rangeSet.contains(28);
        System.out.println("Contains 8: " + containsValue1);
        System.out.println("Contains 28: " + containsValue2);

        // Perform some unrelated calculations
        int sum = 0;
        for (int i = 0; i < 10; i++) {
            sum += i;
        }
        System.out.println("Sum of numbers from 0 to 9: " + sum);

        // Perform further operations on TreeRangeSet
        rangeSet.add(Range.closed(60, 70));

        // Finally, check if the specific value is contained in the TreeRangeSet
        /* read */ boolean containsValue = rangeSet.contains(5);
        System.out.println("Contains 5: " + containsValue);
    }
}
